import React from 'react';
import { connect } from "react-redux";
import ProjectForm from './ProjectForm';
import _ from 'lodash';

import { getMetatData } from "../../actions";

class CreateProject extends React.Component{

    componentDidMount(){
        console.log("COMPONENT DID MOUNT");
        this.props.getMetatData();
    }
    

    render(){

        console.log("INSIDE RENDER CREATE",this.props);

        if (!this.props.client) {
            return <div>Loading...</div>;
        }


        return (
            <div className="ui form">
            <h3 className="ui dividing header">Project Information</h3>
            <ProjectForm/>
            </div>
        );

    }
}
    

const mapStateToProps=(state)=>{
    
    return {
        client:state.client,
        employee:state.employee,
    
    }
}


export default connect(mapStateToProps,{getMetatData})(CreateProject);
